window.bookSummaryJSON = "<p>I’m a nobody...until everybody realizes who I am and who I’m related to.&nbsp;</p> <p>Then, it’s like a giant target that is painted on my back. They all think they can use me to climb the Rosewood High royalty ladder.&nbsp;</p> <p>They obviously underestimate me. I won’t cower down or give in.&nbsp;</p> <p>They can’t break me. But he can...without even trying.&nbsp;</p> <p>Zayn Hunter.&nbsp;</p> <p>He doesn’t want to use me.... He’s already at the top - one of the kings of the school.&nbsp;</p> <p>He wants something else. Something he can’t have.&nbsp;</p> <p>Me.&nbsp;&nbsp;</p> <p>Yet, he’s always there, living up to his name. Stalking me, like I’m his prey...</p> <p>Maybe, I am.&nbsp;</p> <p>Even with the teasing and taunting, he’s not the real predator. He’s my protector. His rescuing could be my undoing.&nbsp;</p> <p>Because, not everything is a game, and the boy I love to hate isn’t the only one watching.&nbsp;</p> <p>He just might be the only one who sees me.... The real me.&nbsp;</p> <p>I just hope it’s enough.&nbsp;</p> <p>Dear listeners,<i> Hunter </i>is a dark high school bully romance and the fifth in the emotional and addictive Rosewood High series.</p>"; 
